import React, { useState } from 'react'



const date = new Date();
const res = date.toLocaleTimeString();




const Profile = () => {
  const [times, setTimes]= useState(0)

  const test = ()=>{setInterval(() => { setTimes(times+1)

  }, 1000);}  ;




  return (
    <div >
      <div >{times}
      <button onClick={test} >Change it</button></div>

    </div>
  )
}

export default Profile
